import React from 'react';

const Card = ({ className, ...props }) => {
  return (
    <div
      className={`bg-white/80 backdrop-blur-sm shadow-sm border border-purple-100 rounded-lg hover:shadow-md transition-shadow ${className}`}
      {...props}
    />
  );
};

export default Card;
